// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CompanionSummonerXXII {
    address public steward;

    struct Companion {
        string name;
        string trait;
        string drift;
        string resonance;
        string codexRef;
        string signature;
        string sanctum;
        string chant;
        string choreography;
        string signal;
        string stewardName;
        string registry;
        string hum;
